import React from 'react';
import { NavLink, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const navItems = [
  { path: '/dashboard', icon: '⊞', label: 'Dashboard' },
  { path: '/groups', icon: '◈', label: 'Groups' },
  { path: '/expenses', icon: '◎', label: 'Expenses' },
  { path: '/settlements', icon: '⇄', label: 'Settlements' },
  { path: '/ai-insights', icon: '✦', label: 'AI Insights' },
];

export default function Sidebar() {
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  const initials = user?.name
    ? user.name.split(' ').map(n => n[0]).join('').toUpperCase().slice(0, 2)
    : 'SS';

  return (
    <aside style={styles.sidebar}>
      {/* Logo */}
      <div style={styles.logo}>
        <div style={styles.logoIcon}>S</div>
        <div>
          <div style={styles.logoText}>SplitSmart</div>
          <div style={styles.logoSub}>AI Expense Splitter</div>
        </div>
      </div>

      {/* Glow line */}
      <div style={styles.glowLine} />

      {/* Nav */}
      <nav style={styles.nav}>
        {navItems.map(item => (
          <NavLink
            key={item.path}
            to={item.path}
            style={({ isActive }) => ({
              ...styles.navItem,
              ...(isActive ? styles.navItemActive : {}),
            })}
          >
            <span style={styles.navIcon}>{item.icon}</span>
            <span>{item.label}</span>
            {/* Active indicator */}
          </NavLink>
        ))}
      </nav>

      {/* Bottom user section */}
      <div style={styles.userSection}>
        <div style={styles.divider} />
        <div style={styles.userInfo}>
          <div className="avatar">{initials}</div>
          <div style={styles.userDetails}>
            <div style={styles.userName}>{user?.name || 'User'}</div>
            <div style={styles.userEmail}>{user?.email || ''}</div>
          </div>
        </div>
        <button onClick={handleLogout} style={styles.logoutBtn}>
          <span>⏻</span> Sign out
        </button>
      </div>
    </aside>
  );
}

const styles = {
  sidebar: {
    position: 'fixed',
    left: 0,
    top: 0,
    bottom: 0,
    width: 260,
    background: 'var(--bg-secondary)',
    borderRight: '1px solid var(--border)',
    display: 'flex',
    flexDirection: 'column',
    padding: '24px 16px',
    zIndex: 100,
  },
  logo: {
    display: 'flex',
    alignItems: 'center',
    gap: 12,
    padding: '8px 12px',
    marginBottom: 8,
  },
  logoIcon: {
    width: 40,
    height: 40,
    borderRadius: 12,
    background: 'linear-gradient(135deg, var(--accent), #9b93ff)',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    fontFamily: 'var(--font-display)',
    fontWeight: 800,
    fontSize: 22,
    color: 'white',
    boxShadow: '0 4px 20px rgba(108,99,255,0.4)',
  },
  logoText: {
    fontFamily: 'var(--font-display)',
    fontWeight: 700,
    fontSize: 17,
    color: 'var(--text-primary)',
    letterSpacing: '-0.3px',
  },
  logoSub: {
    fontSize: 11,
    color: 'var(--text-muted)',
    marginTop: 1,
  },
  glowLine: {
    height: 1,
    background: 'linear-gradient(90deg, transparent, var(--accent), transparent)',
    opacity: 0.4,
    margin: '16px 0',
  },
  nav: {
    display: 'flex',
    flexDirection: 'column',
    gap: 4,
    flex: 1,
  },
  navItem: {
    display: 'flex',
    alignItems: 'center',
    gap: 12,
    padding: '11px 14px',
    borderRadius: 10,
    color: 'var(--text-secondary)',
    textDecoration: 'none',
    fontSize: 14,
    fontWeight: 500,
    transition: 'all 0.15s',
  },
  navItemActive: {
    background: 'var(--accent-dim)',
    color: 'var(--accent-bright)',
    borderLeft: '3px solid var(--accent)',
  },
  navIcon: {
    fontSize: 18,
    width: 22,
    textAlign: 'center',
  },
  userSection: {
    marginTop: 'auto',
  },
  divider: {
    height: 1,
    background: 'var(--border)',
    margin: '16px 0',
  },
  userInfo: {
    display: 'flex',
    alignItems: 'center',
    gap: 10,
    padding: '8px 10px',
    borderRadius: 10,
    marginBottom: 8,
  },
  userDetails: {
    flex: 1,
    minWidth: 0,
  },
  userName: {
    fontSize: 14,
    fontWeight: 600,
    color: 'var(--text-primary)',
    whiteSpace: 'nowrap',
    overflow: 'hidden',
    textOverflow: 'ellipsis',
  },
  userEmail: {
    fontSize: 11,
    color: 'var(--text-muted)',
    whiteSpace: 'nowrap',
    overflow: 'hidden',
    textOverflow: 'ellipsis',
  },
  logoutBtn: {
    width: '100%',
    display: 'flex',
    alignItems: 'center',
    gap: 8,
    padding: '10px 14px',
    borderRadius: 10,
    border: '1px solid var(--border)',
    background: 'transparent',
    color: 'var(--text-muted)',
    cursor: 'pointer',
    fontSize: 13,
    fontFamily: 'var(--font-body)',
    transition: 'all 0.15s',
  },
};
